  \"2013-03-14T19:24:14.272821\",\n\t\"name\": \"barred-owl-ds8\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data define the current range of
  Barred and hybrid Barred/Spotted Owls in California. The current range includes
  the coastal mountains of northern California from Marin County north to the Oregon
  border, across the mountainous northern part of the state, and south in the Sierra
  Nevada to Tulare County. The first of these 1,462 observations was made in 1978
  and the last in December 2007. They represent what we believe are 300 unique owl
  sites distributed across 20 counties in California. There also are three observation
  records from just across the border in Oregon. The majority of these observations
  have come from researchers, biologists, and foresters surveying for Spotted Owls.
  A few early observations were made by chance. About half of the records are new
  thanks to the compilation effort in 2006 by Brian Woodbridge, USFWS, Yreka, CA.
  The survey method used for Spotted Owls (see G.S. Miller et al., 3/7/1992, \"Protocol
  for surveying proposed management activities that may impact northern spotted owls\",
  U.S. Fish and Wildlife Service; also online at http://www.dfg.ca.gov/hcpb/species/stds_gdl/bird_sg/nsoproto.shtml
  , last accessed on 3/19/08) also works well for Barred Owls. Most Barred Owl observations
  reported here have been made using methods similar to those presented in the Spotted
  Owl survey protocols.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
